import React from "react";
function Navbar() {
  return (
    <div className="container">
      <div className="row-12">
        <nav>
          <button class="btn btn-outline-success my-2 my-sm-0" type="submit">
            Search
          </button>{" "}
          <input placeholder="name" type="search" />
        </nav>
      </div>
    </div>
  );
}
export default Navbar;
